//import styledAnimals from "./Animals.module.css"

export default class Animals extends React.Component {
  constructor(props) {
    super(props)
  }

  render() {
    // console.log(this.props.animals)
    return (
      <div/*  className={styledAnimals.container} */>

        {this.props.animals.map((animal , index) => {

          return(
            <div /* className={styledAnimals.containerAnimals} */>

             <h1 key={index + an}>{animal.name}</h1>
             <img key={index} src={animal.image} alt={animal.name} width="300px" />
             <span key={index}>{animal.name}</span>
      </div>
             )

          // <img src={animal.image} alt="" />
        })}
      </div>
    )
  }
}
